public synchronized void processBlockMlockEvent(ExtendedBlockId blockId) {
  if (!enabled) return;
  Set<Slot> affectedSlots = slots.get(blockId);
  for (Slot slot : affectedSlots) {
    slot.makeAnchorable();
  }
}
